import React from "react";
import "../Home.css";
import { AiFillVideoCamera } from "react-icons/ai";
import { BiPhotoAlbum } from "react-icons/bi";
import { GiRadioactive } from "react-icons/gi";

function Bodydiv() {
  return (
    <div className="Bodydiv">
      <div className="stories">
        <div
          style={{
            height: "30vh",
            width: "8vw",
            backgroundColor: "white",
            boxShadow: "5px 10px 8px #888888",
            borderRadius: "10px",
          }}
        ></div>
        <div
          style={{
            height: "30vh",
            width: "8vw",
            backgroundColor: "white",
            boxShadow: "5px 10px 8px #888888",
            borderRadius: "10px",
          }}
        ></div>
        <div
          style={{
            height: "30vh",
            width: "8vw",
            backgroundColor: "white",
            boxShadow: "5px 10px 8px #888888",
            borderRadius: "10px",
          }}
        ></div>
        <div
          style={{
            height: "30vh",
            width: "8vw",
            backgroundColor: "white",
            boxShadow: "5px 10px 8px #888888",
            borderRadius: "10px",
          }}
        ></div>
        <div
          style={{
            height: "30vh",
            width: "8vw",
            backgroundColor: "white",
            boxShadow: "5px 10px 8px #888888",
            borderRadius: "10px",
          }}
        ></div>
      </div>
      {/* ////// */}

      <div
        style={{
          height: "20vh",
          width: "40vw",
          backgroundColor: "white",
          boxShadow: "5px 10px 8px #888888",
          borderRadius: "10px",
          marginTop: "20px",
          marginLeft: "80px",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "space-around",
            alignItems: "center",
            marginTop: "20px",
            height: "10vh",
            width: "40vw",
          }}
        >
          <div
            style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}
          ></div>
          <input
            style={{
              height: "5vh",
              borderRadius: "20px",
              width: "35vw",
              backgroundColor: " rgb(228, 227, 225)",
              border: "none",
              outline: "none",
            }}
            placeholder="What's on your mind,Limu?"
          ></input>
        </div>

        <hr style={{ width: "35vw" }}></hr>

        <div
          style={{
            display: "flex",
            justifyContent: "space-around",
            alignItems: "center",
            height: "6vh",
            width: "40vw",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
              width: "8.5vw",
            }}
          >
            <AiFillVideoCamera size="30px" />
            <h4>Live video</h4>
          </div>

          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
              width: "6vw",
            }}
          >
            <BiPhotoAlbum size="30px" />
            <h4>Photo</h4>
          </div>

          <div
            style={{
              display: "flex",
              justifyContent: "space-around",
              alignItems: "center",
              width: "8.5vw",
            }}
          >
            <GiRadioactive size="30px" />
            <h4>Activities</h4>
          </div>
        </div>
      </div>
      {/* ////////////////////////// */}

      <div
        style={{
          height: "10vh",
          width: "40vw",
          backgroundColor: "white",
          boxShadow: "5px 10px 8px #888888",
          borderRadius: "10px",
          marginTop: "20px",
          marginLeft: "80px",
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
        }}
      >
          <div className="createroom">
              <AiFillVideoCamera size="25"/>
              <h4>Create room</h4>
              </div>
              <div className="moredivs">
                  <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
                  <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
                  <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
                  <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
                  <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
                      <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
              </div>
              </div>

              {/* /////////////////////// */}
          <div className="picdiv">
              <div>
        <div className="picicon">
        <div     style={{
              height: "40px",
              borderRadius: "50%",
              width: "40px",
              backgroundColor: "red",
            }}></div>
            <h4>Limu Islam</h4>

        </div>
        </div>
<hr style={{display:'flex',alignItems:'center',justifyContent:'center'}}></hr>
          </div>
         
              

      {/* last */}
    </div>
  );
}

export default Bodydiv;
